customCSS:
/* nav menu */
.comm-navigation.forceCommunityGlobalNavigation {
    padding: 0 0 0 16px;
}
.forceCommunityGlobalNavigation .slds-is-fixed>.slds-list_vertical {
    background-color: white;
}
.forceCommunityGlobalNavigation .comm-navigation__list.slds-list_vertical .slds-list__item {
    border-bottom: 1px solid lightgray;
    text-align: left;
}
.forceCommunityGlobalNavigation .comm-navigation__list.slds-list_vertical .slds-list__item a:hover span,
.forceCommunityGlobalNavigation .comm-navigation__list.slds-list_vertical .slds-list__item a:focus span{
    color: black;
}
.forceCommunityGlobalNavigation .slds-list__item a, 
.forceCommunityGlobalNavigation .slds-list__item button {
    text-transform: none !important;
}
.forceCommunityGlobalNavigation .slds-list_horizontal>.slds-list__item>a:hover, 
.forceCommunityGlobalNavigation .slds-list_horizontal>.slds-list__item>a.slds-is-active:not([data-type="home"]),
.forceCommunityGlobalNavigation .slds-list_horizontal>.slds-list__item>button:hover, 
.forceCommunityGlobalNavigation .slds-list_horizontal>.slds-list__item>button.slds-is-active:not([data-type="home"]) {
    background-color: transparent !important;
}
.forceCommunityGlobalNavigation a:hover > span{
    color: #036f54;
}

.forceCommunityGlobalNavigation .slds-list_horizontal>.slds-list__item>a.slds-is-active > span {
    color: #036f54;
    font-weight: bold;
}

@font-face {
    font-family: 'FontAwesome';
    src: url('/resource/FontAwesome/webfonts/fa-regular-400.woff?v=5.5.0');
    font-weight: normal;
    font-style: normal
}

.cCustomLayoutNoImage .searchRegion{
    display: none;
}

.slds-grid_align-center{
    padding-top: 3% !important;
}

.forceCommunityGlobalNavigation {
    background-color: transparent !important;
}

.forceCommunityGlobalNavigation * {
    color: black;
}

/* template footer */
.template-footer .footer {
    background-color: #1B1B1B;
    font-family: "Open Sans", Arial, sans-serif;
    line-height: 26px;
}

.template-footer .footer-content .semi-bold {
    font-weight: 600;
}

.template-footer .footer-content .fLinks__item {
    display: block;
    margin-bottom: 16px;
}

.template-footer .footer a {
    text-decoration: underline;
}

.template-footer .footer a:hover {
    text-decoration: none !important;
}

.forceCommunityRichText .footer ul>li:before {
    content: '';
    display: none;
}

