.template-footer .footer .link-social {
    text-decoration: none;
}

.forceCommunityRichText .footer ul li,
.forceCommunityRichText .footer ul {
    padding-left: 0;
}

@media screen and (max-width: 980px) {
    .template-footer .footer-content {
        width: 100%;
    }
}

.template-footer .footer p {
    display: inline-block;
    width: 100%;
}

.signOff__items {
    display: inline-block;
}
.signOff__items:after {
    content: "|";
}
.signOff__items:last-child:after {
    content: "";
}

/* articles in sidebar */
.phone-numbers {
    padding: 0 15px;
}

.forceCommunityCaseDeflection h1 {
    text-align: left;
}

.comm-topic-trending-articles>h2 {
    text-transform: unset !important;
}
.comm-topic-trending-articles a > span:first-child {
    color: #1E6247;
    font-family: Lato;
    font-size: 14px;
    font-weight: 500;
}
.comm-topic-trending-articles a {
	border: none;
	display: inline-block;
	left: -4px;
    padding: 0;
	position: relative;
    vertical-align: text-top;
}

.comm-topic-trending-articles li {
    list-style: inside;
	padding: 8px 0;
}

.forceCommunityCaseDeflection .header-message,
.comm-topic-trending-articles>h2,
.selfServiceTopicRelatedArticle .headerLabel {
    background-color: #1E6247;
    color: white;
    padding: 10px;
}

/* FAQs */
.selfServiceTopicRelatedArticle {
	background-color: #EDEDED;
    padding: 15px;
}

.selfServiceTopicRelatedArticle .headerLabel {
	color: white;
    display: inline-block;
	font-size: 1rem;
    width: 100%;
}

.selfServiceTopicRelatedArticle h2 .headerLabel {
	color: white;
	font-size: 1rem;
}

.selfServiceBaseArticleList .article-item.selfServiceArticleListItem {
	background-color: #EDEDED;
}

.selfServiceBaseArticleList ul.article-list {
	margin: 0;
}

.selfServiceArticleListItem h3.article-head {
    color: #1E6247;
	font-family: Lato;
	font-size: 14px;
	font-weight: 500;
}

.selfServiceArticleListItem article.summary {
    display: inline-block;
    margin-left: -4px;
    vertical-align: top;
}

.selfServiceBaseArticleList .article-item.selfServiceArticleListItem {
    list-style: inside;
    padding: 8px 0;
}

.ui-widget:nth-of-type(2) .selfServiceArticleListItem .view-count,
.ui-widget:nth-of-type(3) .selfServiceArticleListItem .date,
.selfServiceArticleListItem .dot,
.selfServiceArticleListItem .article-type {
    display: none;
}

.selfServiceArticleListItem .view-count:before {
    content: "\1f441";
    font-size: 14px;
    padding-right: 2px;
    color: black;
}


.forceCommunityCaseDeflection, 
.ui-widget[data-component-label="Trending Articles by Topic"] {
    background-color: #EDEDED;
    padding: 15px;
}

.forceCommunityRichText .footer a,
.forceCommunityRichText .footer a:active,
.forceCommunityRichText .footer a:hover,
.forceCommunityRichText .footer a:visited{
    color: white;
}

.rotate-left {
    transform: rotate(-90deg);
}
.rotate-right {
    transform: rotate(90deg);
}

.flip-v {
    transform: scaleY(-1);
    -moz-transform: scaleY(-1);
    -webkit-transform: scaleY(-1);
    -ms-transform: scaleY(-1);
}

.categories-accordion .slds-accordion__section li {
    list-style: inside;
    padding: 0 20px;
}

.categories-accordion li a {
    color: #166C4F;
    text-decoration: underline;
}

.categories-accordion .slds-is-open .slds-accordion__summary {
    padding: 15px 0;
}

.step-link a,
.step-link a:hover,
.step-link a:active,
.step-link a:visited {
    background-color: #F0F0F0;
    color: black !important;
    display: block;
    padding: 20px 0 20px 30px;
    text-decoration: none;
}

.orange-link {
    color: white !important;
    display: inline-block;
	margin-top: 20px;
    text-align: center;
    width: 200px;
}

.green-checkmark {
    background-color: #247D5B;
    border-radius: 50%;
    color: white;
    display: inline-block;
    height: 25px;
    margin-right: 10px;
    width: 25px;
}

/* knowledge component */
.selfServiceTopicRelatedArticle .headerLabel {
    text-transform: unset !important;
}

/* profile widget broken on custom layout */
.profileDetailView .slds-col,
.selfServiceArticleLayout .slds-col {
    flex-grow: 1;
}
.profile-name-button-container {
    text-align: right;
}

button.green-button {
    border: none;
    color: white;
    background-color: #156b4f;
    margin-bottom: -10px;
    padding: 6px 10px;
    display: inline-block;
}

/* Knowledge article detail - hiding */
.forcePageBlockSectionRow:nth-of-type(1), 
.forcePageBlockSectionRow:nth-of-type(3) {
    display: none;
}
.selfServiceArticleLayout.zoom .test-id__field-label-container,
.selfServiceArticleHeaderDetail,
.selfServiceArticleLayout article.content .forcePageBlockSection:not(:first-of-type), /* FAQ below content */
article.voting.selfServiceArticleLayout /* voting for knowledge article */ {
    display: none;
}

.selfServiceArticleLayout.zoom .article-summary, 
.selfServiceArticleLayout.zoom .forcePageBlockSectionView.full .test-id__field-value, 
.selfServiceArticleLayout.zoom .forcePageBlockSectionView.full .test-id__field-value span, 
.forcePageBlockSectionView .slds-rich-text-editor__output {
    color: rgb(37, 37, 37);
	font-family: "Open Sans", Arial, sans-serif !important;
	font-size: 16px !important;
    line-height: 27.2px;
}

.selfServiceArticleLayout.zoom .article-summary, 
.selfServiceArticleLayout.zoom .forcePageBlockSectionView.full .test-id__field-value a {
	color: rgb(106, 51, 37);
}

.selfServiceArticleLayout.zoom .article-head {
    color: rgb(51, 51, 51);
    display: inline-block;
    font-family: "Open Sans",Arial,sans-serif;
    font-size: 32px !important;
	font-weight: 400;
}
.selfServiceArticleLayout.zoom.article-column {
    padding: 0 !important;
}

.selfServiceArticleLayout .slds-grid.itemBody {
    padding-bottom: 10px; /* push grey bottom border down*/
}
/* Hiding profile links */
.uiMenu.selfServiceUserProfileMenu .myAccount.uiMenuItem {
    display: none;
}
/* Hiding Profile sections */
.forceCommunityUserSettings .row:first-of-type, 
.forceCommunityUserSettings .row.locationSection, 
.forceCommunityUserSettings .row.profileVisibilitySection, 
.forceCommunityUserSettings .row.emailNotificationsSection {
	height: 0;
    margin: 0;
	visibility: hidden;
}

.forceChatterUpdatePhoto .updatePhotoPanel .uiInputCheckbox /* checkbox when updating profile photo */{
    display: none;
}
.forceCommunityUserProfileBody .cProfileViewBody {
    background-color: #f0f0f0 !important;
    border: none !important;
}

.slds-button, 
.slds-button-group .slds-button:only-child, 
.slds-button-group-list li:only-child .slds-button {
    border-radius: 0;
}

.profileDetailView .userDetailHeader .branding-actions li.slds-button--neutral a {
    color: white;
    border: none;
}

.forceCommunityUserSettings .row.accountSection {
	border-top: 1px double #d4d4d4!important;
    padding-top: 15px;
}
.forceCommunityUserSettings .row.accountSection h2 {
    display: none;
}
.profileDetailView .userDetailHeader .branding-actions li.slds-button--neutral {
    background-color: #156b4f;
}

.forceCommunityUserSettings .savecancelbuttoncontainer {
    padding-right: 44px;
}

.profileDetailView .forcePageBlockSectionRow .slds-form-element_readonly {
	border-bottom: none;
}

@media (max-width: 480px) {
    .slds-page-header__title .back.button {
        height: 36px !important;
        width: 36px !important;
    }
    .back-container svg.slds-icon {
        width: 18px;
        height: 22px;
    }
    .slds-page-header__title h2 .question {
        font-size: 24px;
        line-height: 43px;
        margin-left: 18px;
        padding-top: 0;
        margin-top: -10px;
    }

    .slds-page-header .slds-page-header__row .slds-media__figure i {
        height: 36px !important;
        width: 36px !important;
        font-size: 18px !important;
    }

    .user-profile.slds-page-header .slds-page-header__name-title h2 span,
    .cMyRequestRecordListPage .slds-page-header .slds-page-header__title,
    .cMyFollowedRequests .slds-page-header .slds-page-header__title {
        font-size: 28px !important;
        line-height: 43px !important;
        padding-left: 0 !important;
        margin-top: -10px !important;
    }
}
